  handleClickMap(e){
    $('.loc_active').removeClass('loc_active').addClass('loc_set')
    $(e.target).removeClass('loc_inactive').addClass('loc_active')
    $('.loc').not('.loc_active').addClass('loc_inactive')
    $('.locArrow_target').removeClass('locArrow_target')
    var activeLocNum=(e.target.getAttribute('id').replace(/\D/g,''));
    var stateArrowTarget=activeLocNum-1
    this.setState({target: stateArrowTarget})
    $(`#locArrow-${activeLocNum}`).removeClass('locArrow_inactive').addClass('locArrow_target')
    if(e.target.classList.contains('loc_set')){
      var newVal = this.state.locArrows[stateArrowTarget].rotate
      this.setState({value:newVal + 90})
    }
    else if(!e.target.classList.contains('loc_set')){
      this.setState({value:180})
    }
  }

  handleClickMapAway(){
    $('.loc_active').removeClass('loc_active').addClass('loc_set')
    $('.locArrow_target').removeClass('locArrow_target')
    this.setState({target: null})
  }

  handleSliderChange(e) {
    this.setState({value: e.target.value});
    if(this.state.target != null){
      var dummy=this.state.locArrows[this.state.target]
      dummy.rotate=e.target.value-90
      this.setState({dummy})
    }
  }

